import React from "react";

const UserTotalPoints = ({pointsTotal}) => (
    <div>
        <p className={'bigProfileData'}><span className={'profileDataBold'}>{pointsTotal[0]}</span>{pointsTotal[1]}</p>
    </div>
);

export default UserTotalPoints;
